const GetWeather = () =>{
    const Wea = () =>{
        const APIKey = '76e81f20536a80f8fcc25c183ec6ec0a';
        const lat = 44.651070;
        const lon = -63.582687;
        fetch(`https://api.openweathermap.org/data/2.5/weather?lat=${lat}&lon=${lon}&appid=${APIKey}`)
        .then(response => response.json())
        .then(json => {
            // json.cod;
            // temperature = `${parseInt(json.main.temp)}°C`
            // weather = `${json.weather[0].description}`
            // console.log(temperature)
            // console.log(weather)
            return `${parseInt(json.main.temp)}°C`
        })
    }
    var temperature = '0°C';
    var weather = 'cloud';
    weather = Wea();
    return <div>{temperature} {weather}</div>;
}
export default GetWeather;

